import React, { Component } from 'react'
import styled from 'styled-components'

const StyledNav = styled.p`
  color: lavender;
  a {
    text-decoration: none;
    color: black 
  }
`

class Nav extends Component {
  render() {
    return (
      <StyledNav>
        <ul>
          <li><a href="/">sign in</a></li>
          <li><a href=""></a></li>
          <li><a href=""></a></li>
        </ul>
      </StyledNav>
    )
  }
}

export default Nav;
